import Task from "./Task";
import { FaArrowUp, FaArrowDown } from "react-icons/fa";
const Appointments = ({ tasks, onDelete, onToggle, showApp, onShow }) => {
  return (
    <>
      <h2 onClick={onShow}>
        Long Term Tasks
        {showApp ? <FaArrowUp /> : <FaArrowDown />}
      </h2>
      {tasks.map(
        (task) =>
          task.type === "long" &&
          showApp && (
            <Task
              key={task.id}
              task={task}
              onDelete={onDelete}
              onToggle={onToggle}
              onshow={onShow}
            ></Task>
          )
      )}
    </>
  );
};

export default Appointments;
